render() {
    return (
        <ul>
            {this.props.items.map((item, index) => (
              <li key={index}>
                {item.text}
                <button value={index} onClick={() => props.remove(index)}>x</button>
              </li>
            ))}
        </ul>
    );
}
}

export default Child;
